import React from "react";

import MobileViewInfo from "common/components/MobileViewInfo";
import { BrowserView, MobileOnlyView } from "react-device-detect";
import App from "modules/photoBooth/components/pbMobile";

const PhotoBooth = () => {
  return (
    <>
      <BrowserView>
        <h1>This is rendered only in browser</h1>
      </BrowserView>
      <MobileOnlyView>
        <App />
      </MobileOnlyView>
    </>
  );
};

export default PhotoBooth;
